import React from "react";
import BreedImage from "./BreedImage.js";

const BreedCard = (props) => {

  return (
      <figure className="breedCard">
          <figcaption>{props.breed.name}</figcaption>
          <BreedImage race={props.breed.id} />
      </figure>
  );
}

export default BreedCard;
